import './navitems.css'



const NavI = (props) => {
  return (
<li className='nav-item'>
    {props.children}
</li>
  )
}




const NavIDropDown = (props) => {
    return (
  <li className='dropdown-item'>
      {props.children}
  </li>
    )
  }

export default NavI
export {NavIDropDown}
